import "./searchSuffix.css";
import Amazon from "./amazon (1).png";
import Flipkart from "./flipkart (1).png";
import Snapdeal from "./snapdeal (1).png";

export default () => {
  return (
    <>
      <div className="searchSuffix">
        <h3>Search directly on :</h3>
      </div>
      <div className="image">
        <img src={Amazon} alt="amazon-png" className="amazon"></img>
        <img src={Flipkart} alt="flipkart-png"></img>
        <img src={Snapdeal} alt="snapdeal-png"></img>
      </div>
    </>
  );
};
